      out.write("function numberToWords(RupeesId,number) {  \r\n");
      out.write("    var digit = ['zero', 'one', 'two', 'three', 'four', 'five', 'six', 'seven', 'eight', 'nine'];  \r\n");
      out.write("    var elevenSeries = ['ten', 'eleven', 'twelve', 'thirteen', 'fourteen', 'fifteen', 'sixteen', 'seventeen', 'eighteen', 'nineteen'];  \r\n");
      out.write("    var countingByTens = ['twenty', 'thirty', 'forty', 'fifty', 'sixty', 'seventy', 'eighty', 'ninety'];  \r\n");
      out.write("    var shortScale = ['', 'thousand', 'million', 'billion', 'trillion'];  \r\n");
      out.write("\r\n");
      out.write("    number = number.toString();\r\n");
      out.write("    number = number.replace(/[\\, ]/g, '');\r\n");
      out.write("    if (number != parseFloat(number)) return 'not a number';\r\n");
      out.write("    var x = number.indexOf('.');\r\n");
      out.write("    if (x == -1) x = number.length; if (x > 15) return 'too big';\r\n");
      out.write("    var n = number.split(''); \r\n");
      out.write("    var str = ''; \r\n");
      out.write("    var sk = 0;\r\n");
      out.write("    for (var i = 0; i < x; i++) { \r\n");
      out.write("    	if ((x - i) % 3 == 2) { \r\n");
      out.write("    		if (n[i] == '1') { \r\n");
      out.write("    			str += elevenSeries[Number(n[i + 1])] + ' '; \r\n");
      out.write("    			i++; sk = 1; \r\n");
      out.write("    			} else if (n[i] != 0) { \r\n");
      out.write("    				str += countingByTens[n[i] - 2] + ' ';\r\n");
      out.write("    				sk = 1;\r\n");
      out.write("    				} } else if (n[i] != 0) { \r\n");
      out.write("    					str += digit[n[i]] + ' ';\r\n");
      out.write("    					if ((x - i) % 3 == 0) str += 'hundred ';\r\n");
      out.write("    					sk = 1; \r\n");
      out.write("    					} if ((x - i) % 3 == 1) { \r\n");
      out.write("    						if (sk) str += shortScale[(x - i - 1) / 3] + ' ';\r\n");
      out.write("    						sk = 0; \r\n");
      out.write("    						} \r\n");
      out.write("    					} if (x != number.length) {\r\n");
      out.write("    							var y = number.length;\r\n");
      out.write("    							var str1='point ';\r\n");
      out.write("    							var z=0;\r\n");
