      out.write("    								str1 += digit[n[i]] + ' '; \r\n");
      out.write("    							}\r\n");
      out.write("    							if(z>0){\r\n");
      out.write("    								str+=str1;\r\n");
      out.write("    							}\r\n");
      out.write("    							} \r\n");
      out.write("    						str = str.replace(/\\number+/g, ' ');    						 \r\n");
